INSERT INTO `mdl_course` VALUES (1,0,1,'Sri Guru Granth Sahib World University','SGGSWU','','<img src=\"https://sggswu.edu.in/assets/img/sggswu.png\" alt=\"SGGSWU Logo\" width=\"452\" height=\"157\" role=\"presentation\" class=\"img-responsive atto_image_button_text-bottom\">\r\n<p dir=\"ltr\" style=\"text-align: left;\">\r\n</p>\r\n<p><br>\r\n  </p><div class=\"col-lg-12\">\r\n        <h2>About SGGSWU</h2>\r\n        <span style=\"float: right\">\r\n                                        \r\n<div id=\"google_translate_element\"><div class=\"skiptranslate goog-te-gadget\" dir=\"ltr\" style=\"\"><div id=\":0.targetLanguage\" class=\"goog-te-gadget-simple\" style=\"white-space: nowrap;\"><img src=\"https://www.google.com/images/cleardot.gif\" class=\"goog-te-gadget-icon\" alt=\"\" style=\"background-image: url(&quot;https://translate.googleapis.com/translate_static/img/te_ctrl3.gif&quot;); background-position: -65px 0px;\"><span style=\"vertical-align: middle;\"><a aria-haspopup=\"true\" class=\"goog-te-menu-value\" href=\"javascript:void(0)\"><span>Select Language</span><img src=\"https://www.google.com/images/cleardot.gif\" alt=\"\" width=\"1\" height=\"1\"><span style=\"border-left: 1px solid rgb(187, 187, 187);\">​</span><img src=\"https://www.google.com/images/cleardot.gif\" alt=\"\" width=\"1\" height=\"1\"><span aria-hidden=\"true\" style=\"color: rgb(118, 118, 118);\">▼</span></a></span></div></div></div><script type=\"text/javascript\">\r\nfunction googleTranslateElementInit() {\r\nnew google.translate.TranslateElement({pageLanguage: \'en\', layout: google.translate.TranslateElement.InlineLayout.SIMPLE}, \'google_translate_element\');	\r\n//  new google.translate.TranslateElement({pageLanguage: \'en\', includedLanguages: \'ar,en,pt,zh-CN\', layout: google.translate.TranslateElement.InlineLayout.SIMPLE}, \'google_translate_element\');\r\n}\r\n</script>\r\n<script type=\"text/javascript\" src=\"//translate.google.com/translate_a/element.js?cb=googleTranslateElementInit\"></script>\r\n\r\n        </span>\r\n        <div class=\"width-4rem height-4 bg-primary rounded mt-4 marginBottom-40\"></div>\r\n        <p class=\"mb-5\">\r\n          </p><p style=\"text-align: justify;\"><span style=\"font-size:26px;\"><strong>SGGSWU - Overview</strong></span></p>\r\n\r\n<p style=\"text-align: justify;\">Sri Guru Granth Sahib World University, Fatehgarh Sahib, a project undertaken by the SGPC is a missionary, charitable and humanitarian institution, seeks to impart inclusive education to learners from all creeds, castes and religions. Sardar Parkash Singh Badal, the former Chief Minister had announced during fourth centenary celebrations of the installation of Sri Adi Granth at Golden Temple that a university dedicated to the ideals enshrined in Sri Guru Granth Sahib would be established. His dream reached fruition when the Punjab Legislative Assembly passed Sri Guru Granth Sahib World University Act (Punjab State Act 20/2008) and the SGGSWU commenced its first academic session in July 2011. The University has also secured the membership of AIU (Association of Indian Universities)- Membership No. 614.</p>\r\n\r\n<p style=\"text-align: justify;\">There has been no looking back since then. With all kinds of support from the State and the SGPC, the University has made rapid strides, in a short span of time, to emerge as a premier institution of higher learning in North India. Several innovative academic programmes in the fields of emerging technologies, sciences and humanities are being run by the University for the benefit of the students. Major thrust areas of the University are promotion of value based quality education and research. It is a matter of great pride for us that research projects worth more than Rs. 3&nbsp;crores have been awarded to the University faculty by the national agencies such as the DST, CSIR and DAE etc. A large number of faculty members are actively involved in carrying out research and publish their papers regularly in journals of international and national repute.</p>\r\n\r\n<p style=\"text-align: justify;\">Workshops and competitions for the holistic growth of personality of the learners and for providing hands-on training in the use of scientific equipment are structured into the very curriculum, the University offers.</p>\r\n\r\n<p style=\"text-align: justify;\">In order to promote scholastic excellence and interdisciplinary approach, the academic structure of the University has been divided into Faculty System. The University learners are provided with the state-of -the-art technological infrastructure by way of very well equipped labs. In order to promote inclusive education and merit, several scholarships are provided by the University to the needy and meritorious students, students belonging to minority communities, SC, ST, and single girl child students. Apart from this, fee concessions and scholarships are provided to meritorious students.</p>\r\n\r\n<p style=\"text-align: justify;\">Modern life is characterized by alienations of myriad hues. The teachings of the Sikh Gurus, enshrined in Sri Guru Granth Sahib can go a long way in healing the rift which scars the psyche of the modern man by uniting him to his own self, the society around him and to the Divine Light whose residence is the human heart. The University has adopted five neighboring villages for their overall development. The University seeks to promote holistic growth of the learners\' personality. Hence, along with the pursuit of excellence in academics, there is great emphasis on sports, extra-curricular and extra-mural activities.</p>\r\n\r\n<p style=\"text-align: justify;\">This is owing to the University\'s impetus on the overall personality development of its students that the training and placement cell of the University has achieved success in providing attractive job offers with packages of up to Rs. 12 lakh per annum to the students. The University Training and Placement Cell, is whole heartedly committed to get each and every student placed in reputed companies. The University students, specifically from sciences and engineering courses are also making their mark in R&amp;D sector at international platform. In a short span of time, the University has emerged as a podium for bright future of young India.</p>\r\n\r\n<p style=\"text-align: justify;\"><span style=\"font-size:26px;\"><strong>SGGSWU - Identity</strong></span></p>\r\n\r\n<p style=\"text-align: justify;\"><span style=\"line-height:150%\">The University owes its identity to the rich legacy of the Shiromani Gurdwara Parbandhak Committee (SGPC). The SGPC, a parliamentary body of the Sikh community, besides managing the Holy Sikh Shrines, runs many prestigious educational institutions including two Universities, a Medical College, a Dental College, two Engineering Colleges, an Institute of Research and Development, an Education College, forty-three Degree Colleges, Fifty schools, Charitable Hospitals, and many Charitable trusts. The alumni of its educational institutes are making excellent marks not only as successful professionals in their respective fields, but also by proving themselves as responsible human beings while following the core human values and ethics enshrined in Sri Guru Granth Sahib ji. The SGPC had set up its first educational institute at Mumbai in 1937 and is since then serving the cause of education. The University is a step higher in this service to mankind. The University is the articulation of the aspirations of the Sikh community and aims to excel in facilitating the world class infrastructure and updated practical education to the young aspirants. The University, like its parent-body, is a charitable institute, committed to impart quality education to all sections of society irrespective of caste, creed and religion.</span></p>\r\n\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n        <p></p>\r\n        \r\n                \r\n      </div>\r\n  <p></p>',0,'site',1