 algorithms in common engineering design situations.</li></ol><p></p><p dir=\"ltr\"><strong>COURSE OUTCOMES</strong>:</p><p dir=\"ltr\"></p><ol><li>Ability to analyse the performance of algorithms.</li><li>Ability to choose appropriate algorithm design techniques for solving problems.</li><li>Ability\' to understand how the choice of data structures and the algorithm design methods&nbsp;impact the performance of programs.</li><li>To understand the variations among tractable and intractable problems. To introduce P and&nbsp;NP classes.</li></ol><p></p><br></p>',1,'',1,'{\"op\":\"&\",\"c\":[],\"showc\":[]}',1596378949),(316,64,0,NULL,'',1,'68',1,NULL,1597381800),(317,64,1,NULL,'',1,'',1,NULL,1597381800),(318,64,2,NULL,'',1,'',1,NULL,1597381800),(319,64,3,NULL,'',1,'',1,NULL,1597381800),(320,64,4,NULL,'',1,'',1,NULL,1597381800);
