INSERT INTO `mdl_notifications` VALUES (2,2,3,'Students at risk in Design and Analysis of Algorithm course','Hi Navdeep,\n<p>A number of students in Design and Analysis of Algorithm have not accessed the course recently.</p>\n\nhttp://www.moodle.diljotsingh.com/report/insights/insights.php?modelid=5&contextid=206',2,'<head><style>\nbody:not(.dir-ltr):not(.dir-rtl) {\n    font-family: \'Open Sans\', sans-serif;\n}\n.btn-insight {\n    color: #007bff;\n    background-color: transparent;\n    display: inline-block;\n    font-weight: 400;\n    text-align: center;\n    white-space: nowrap;\n    vertical-align: middle;\n    user-select: none;\n    border: 1px solid #007bff;\n    padding: .375rem .75rem;\n    line-height: 1.5;\n    border-radius: 0;\n    text-decoration: none;\n    cursor: pointer;\n}\n</style></head>\n\nHi Navdeep,\n<p>A number of students in Design and Analysis of Algorithm have not accessed the course recently.</p>\n<br/><br/>\n<a class=\"btn btn-outline-primary btn-insight\" href=\"http://www.moodle.diljotsingh.com/report/insights/insights.php?modelid=5&amp;contextid=206\">View insight</a>','Hi Navdeep,\n<p>A number of students in Design and Analysis of Algorithm have not accessed the course recently.</p>\n\nhttp://www.moodle.diljotsingh.com/report/insights/insights.php?modelid=5&contextid=206','moodle','insights','http://www.moodle.diljotsingh.com/report/insights/insights.php?modelid=5&contextid=206','Students at risk in Design and Analysis of Algorithm course',NULL,1600626424,NULL),(3,2,9,'Students at risk in Design and Analysis of Algorithm course','Hi Test,\n<p>A number of students in Design and Analysis of Algorithm have not accessed the course recently.</p>\n\nhttp://www.moodle.diljotsingh.com/report/insights/insights.php?modelid=5&contextid=206',2,'<head><style>\nbody:not(.dir-ltr):not(.dir-rtl) {\n    font-family: \'Open Sans\', sans-serif;\n}\n.btn-insight {\n    color: #007bff;\n    background-color: transparent;\n    display: inline-block;\n    font-weight: 400;\n    text-align: center;\n    white-space: nowrap;\n    vertical-align: middle;\n    user-select: none;\n    border: 1px solid #007bff;\n    padding: .375rem .75rem;\n    line-height: 1.5;\n    border-radius: 0;\n    text-decoration: none;\n    cursor: pointer;\n}\n</style></head>\n\nHi Test,\n<p>A number of students in Design and Analysis of Algorithm have not accessed the course recently.</p>\n<br/><br/>\n<a class=\"btn btn-outline-primary btn-insight\" href=\"http://www.moodle.diljotsingh.com/report/insights/insights.php?modelid=5&amp;contextid=206\">View insight</a>','Hi Test,\n<p>A number of students in Design and Analysis of Algorithm have not accessed the course recently.</p>\n\nhttp://www.moodle.diljotsingh.com/report/insights/insights.php?modelid=5&contextid=206','moodle','insights','http://www.moodle.diljotsingh.com/report/insights/insights.php?modelid=5&contextid=206','Students at risk in Design and Analysis of Algorithm course',NULL,1600626425,NULL),(4,2,2,'SGGSWU: Automated backup status','Summary\n==================================================\n  Courses: 63\n  OK: 0\n  Skipped: 0\n  Error: 0\n  Unfinished: 0\n  Course backup ad hoc task pending: 63\n  Warning: 0\n  Automated backup pending: 0\n\n  Backup completed successfully\n',2,'','','moodle','backup',NULL,NULL,NULL,1600629689,NULL),(5,2,2,'Moodle updates are available (http://www.moodle.diljotsingh.com)','Update notifications\n\nThere is a newer Moodle version available!\nMoodle 3.9.2+ (Build: 20200918) Version 2020061502.01 (Stable version)\n\nSee http://www.moodle.diljotsingh.com/admin/index.php for more details\n\nIt is strongly recommended that you update your site to the latest version to obtain all recent security and bug fixes.\n\nThere is a newer version for some of your plugins available!\nEdwiser course formats (format_remuiformat) There is a new version 2020090200 available!\n\nSee http://www.moodle.diljotsingh.com/admin/plugins.php for more details\n\nYour Moodle site http://www.moodle.diljotsingh.com is configured to automatically check for available updates. You are receiving this message as the administrator of the site. You can disable automatic checks for available updates in Site administration / Server / Update notifications or customise the delivery of this message via your preferences page.\n',2,'<h1>Update notifications</h1>\n<h2>There is a newer Moodle version available!</h2>\n<ul>\n<li><strong>Moodle 3.9.2+ (Build: 20200918)</strong> Version 2020061502.01 (Stable version)</li>\n</ul>\n<p>See <a href=\"http://www.moodle.diljotsingh.com/admin/index.php\">http://www.moodle.diljotsingh.com/admin/index.php</a> for more details</p>\n<p>It is strongly recommended that you update your site to the latest version to obtain all recent security and bug fixes.</p>\n<h2>There is a newer version for some of your plugins available!</h2>\n<ul>\n<li><strong>Edwiser course formats</strong> (format_remuiformat) There is a new version 2020090200 available!</li>\n</ul>\n<p>See <a href=\"http://www.moodle.diljotsingh.com/admin/plugins.php\">http://www.moodle.diljotsingh.com/admin/plugins.php</a> for more details</p>\n<footer><p style=\"font-size:smaller; color:#333;\">Your Moodle site <a href=\"http://www.moodle.diljotsingh.com\">http://www.moodle.diljotsingh.com</a> is configured to automatically check for available updates. You are receiving this message as the administrator of the site. You can disable automatic checks for available updates in Site administration / Server / Update notifications or customise the delivery of this message via your preferences page.</p></footer>','Update notifications','moodle','availableupdate',NULL,NULL,NULL,1600662604,NULL),(6,2,3,'Moodle updates are available (http://www.moodle.diljotsingh.com)','Update notifications\n\nThere is a newer Moodle version available!\nMoodle 3.9.2+ (Build: 20200918) Version 2020061502.01 (Stable version)\n\nSee http://www.moodle.diljotsingh.com/admin/index.php for more details\n\nIt is strongly recommended that you update your site to the latest version to obtain all recent security and bug fixes.\n\nThere is a newer version for some of your plugins available!\nEdwiser course formats (format_remuiformat) There is a new version 2020090200 available!\n\nSee http://www.moodle.diljotsingh.com/admin/plugins.php for more details\n\nYour Moodle site http://www.moodle.diljotsingh.com is configured to automatically check for available updates. You are receiving this message as the administrator of the site. You can disable automatic checks for available updates in Site administration / Server / Update notifications or customise the delivery of this message via your preferences page.\n',2,'<h1>Update notifications</h1>\n<h2>There is a newer Moodle version available!</h2>\n<ul>\n<li><strong>Moodle 3.9.2+ (Build: 20200918)</strong> Version 2020061502.01 (Stable version)</li>\n</ul>\n<p>See <a href=\"http://www.moodle.diljotsingh.com/admin/index.php\">http://www.moodle.diljotsingh.com/admin/index.php</a> for more details</p>\n<p>It is strongly recommended that you update your site to the latest version to obtain all recent security and bug fixes.</p>\n<h2>There is a newer version for some of your plugins available!</h2>\n<ul>\n<li><strong>Edwiser course formats</strong> (format_remuiformat) There is a new version 2020090200 available!</li>\n</ul>\n<p>See <a href=\"http://www.moodle.diljotsingh.com/admin/plugins.php\">http://www.moodle.diljotsingh.com/admin/plugins.php</a> for more details</p>\n<footer><p style=\"font-size:smaller; color:#333;\">Your Moodle site <a href=\"http://www.moodle.diljotsingh.com\">http://www.moodle.diljotsingh.com</a> is configured to automatically check for available updates. You are receiving this message as the administrator of the site. You can disable automatic checks for available updates in Site administration / Server / Update notifications or customise the delivery of this message via your preferences page.</p></footer>','Update notifications','moodle','availableupdate',NULL,NULL,NULL,1600662605,NULL),(7,2,2,'SGGSWU: [ERROR] Automated backup status','Summary\n==================================================\n  Courses: 63\n  OK: 0\n  Skipped: 59\n  Error: 0\n  Unfinished: 3\n  Course backup ad hoc task pending: 1\n  Warning: 0\n  Automated backup pending: 0\n\n  Some of your courses weren\'t saved!!\n\n  Please take a look at your backup logs in:\n  http://www.moodle.diljotsingh.com/report/backups/index.php\n\n',2,'','','moodle','backup',NULL,NULL,NULL,1600716002,NULL),(8,2,2,'SGGSWU: [ERROR] Automated backup status','Summary\n==================================================\n  Courses: 63\n  OK: 0\n  Skipped: 59\n  Error: 0\n  Unfinished: 3\n  Course backup ad hoc task pending: 1\n  Warning: 0\n  Automated backup pending: 0\n\n  Some of your courses weren\'t saved!!\n\n  Please take a look at your backup logs in:\n  http://www.moodle.diljotsingh.com/report/backups/index.php\n\n',2,'','','moodle','backup',NULL,NULL,NULL,1600802402,NULL),(9,2,2,'SGGSWU: Automated backup status','Summary\n==================================================\n  Courses: 63\n  OK: 1\n  Skipped: 59\n  Error: 0\n  Unfinished: 0\n  Course backup ad hoc task pending: 3\n  Warning: 0\n  Automated backup pending: 0\n\n  Backup completed successfully\n',2,'','','moodle','backup',NULL,NULL,NULL,1600806002,NULL);
