orum-activity-46',46,'Announcements','General news and announcements',754,'mod_forum-activity',1,46,0,1596378530,NULL,NULL,NULL),(61,'mod_forum-activity-45',45,'Announcements','General news and announcements',753,'mod_forum-activity',1,45,0,1596378530,NULL,NULL,NULL),(62,'mod_forum-activity-44',44,'Announcements','General news and announcements',752,'mod_forum-activity',1,44,0,1596378530,NULL,NULL,NULL),(63,'mod_forum-activity-43',43,'Announcements','General news and announcements',751,'mod_forum-activity',1,43,0,1596378530,NULL,NULL,NULL),(64,'mod_forum-activity-61',61,'Announcements','General news and announcements',769,'mod_forum-activity',1,61,0,1596378531,NULL,NULL,NULL),(65,'mod_forum-activity-62',62,'Announcements','General news and announcements',770,'mod_forum-activity',1,62,0,1596378531,NULL,NULL,NULL),(66,'mod_forum-activity-63',63,'Announcements','General news and announcements',771,'mod_forum-activity',1,63,0,1596378531,NULL,NULL,NULL),(67,'mod_forum-activity-64',64,'Announcements','General news and announcements',716,'mod_forum-activity',1,64,0,1597381800,NULL,NULL,NULL),(68,'core_course-course-1',1,'Sri Guru Granth Sahib World University','[SGGSWU Logo] ABOUT SGGSWU Select Language​▼ SGGSWU - OVERVIEW Sri Guru Granth Sahib World University, Fatehgarh Sahib, a project undertaken by the SGPC is a missionary, charitable and humanitarian institution, seeks to impart inclusive education to learners from all creeds, castes and religions. Sardar Parkash Singh Badal, the former Chief Minister had announced during fourth centenary celebrations of the installation of Sri Adi Granth at Golden Temple that a university dedicated to the ideals enshrined in Sri Guru Granth Sahib would be established. His dream reached fruition when the Punjab Legislative Assembly passed Sri Guru Granth Sahib World University Act (Punjab State Act 20/2008) and the SGGSWU commenced its first academic session in July 2011. The University has also secured the membership of AIU (Association of Indian Universities)- Membership No. 614. There has been no looking back since then. With all kinds of support from the State and the SGPC, the University has made rapid strides, in a short span of time, to emerge as a premier institution of higher learning in North India. Several innovative academic programmes in the fields of emerging technologies, sciences and humanities are being run by the University for the benefit of the students. Major thrust areas of the University are promotion of value based quality education and research. It is a matter of great pride for us that research projects worth more than Rs. 3 crores have been awarded to the University faculty by the national agencies such as the DST, CSIR and DAE etc. A large number of faculty members are actively involved in carrying out research and publish their papers regularly in journals of international and national repute. Workshops and competitions for the holistic growth of personality of the learners and for providing hands-on training in the use of scientific equipment are structured into the very curriculum, the University offers. In order to promote scholastic excellence and interdisciplinary approach, the academic structure of the University has been divided into Faculty System. The University learners are provided with the state-of -the-art technological infrastructure by way of very well equipped labs. In order to promote inclusive education and merit, several scholarships are provided by the University to the needy and meritorious students, students belonging to minority communities, SC, ST, and single girl child students. Apart from this, fee concessions and scholarships are provided to meritorious students. Modern life is characterized by alienations of myriad hues. The teachings of the Sikh Gurus, enshrined in Sri Guru Granth Sahib can go a long way in healing the rift which scars the psyche of the modern man by uniting him to his own self, the society around him and to the Divine Light whose residence is the human heart. The University has adopted five neighboring villages for their overall development. The University seeks to promote holistic growth of the learners\' personality. Hence, along with the pursuit of excellence in academics, there is great emphasis on sports, extra-curricular and extra-mural activities. This is owing to the University\'s impetus on the overall personality development of its students that the training and placement cell of the University has achieved success in providing attractive job offers with packages of up to Rs. 12 lakh per annum to the students. The University Training and Placement Cell, is whole heartedly committed to get each and every student placed in reputed companies. The University students, specifically from sciences and engineering courses are also making their mark in R&D sector at international platform. In a short span of time, the University has emerged as a podium for bright future of young India. SGGSWU - IDENTITY The University owes its identity to the rich legacy of the Shiromani Gurdwara Parbandhak Committee (SGPC). The SGPC, a parliamentary body of the Sikh community, besides managing the Holy Sikh Shrines, runs many prestigious educational institutions including two Universities, a Medical College, a Dental College, two Engineering Colleges, an Institute of Research and Development, an Education College, forty-three Degree Colleges, Fifty schools, Charitable Hospitals, and many Charitable trusts. The alumni of its educational institutes are making excellent marks not only as successful professionals in their respective fields, but also by proving themselves as responsible human beings while following the core human values and ethics enshrined in Sri Guru Granth Sahib ji. The SGPC had set up its first educational institute at Mumbai in 1937 and is since then serving the cause of education. The University is a step higher in this service to mankind. The University is the articulation of the aspirations of the Sikh community and aims to excel in facilitating the world class infrastructure and updated practical education to the young aspirants. The University, like its parent-body, is a charitable institute, committed to impart quality education to all sections of society irrespective of caste, creed and religion. ',2,'core_course-course',1,1,0,1596117514,NULL,'SGGSWU',NULL),(69,'core_course-course-4',4,'Applied Mathematics - I','',289,'core_course-course',1,4,0,1596378527,NULL,'MCEF/BCE - 101',NULL),(70,'core_course-course-5',5,'Applied Physics','',290,'core_course-course',1,5,0,1596378527,NULL,'MCEF/BCE - 102',NULL),(71,'core_course-course-6',6,'English','',291,'core_course-course',1,6,0,1596378527,NULL,'MCEF/BCE - 103',NULL),(72,'core_course-course-7',7,'Computer Fundaments and Internet Technology','',292,'core_course-course',1,7,0,1596378527,NULL,'MCEF/BCE - 104',NULL),(73,'core_course-course-18',18,'Programming Methodology Lab','',303,'core_course-course',1,18,0,1596378528,NULL,'MCEF/BCE - 203L',NULL),(74,'core_course-course-24',24,'Environmental Science','',309,'core_course-course',1,24,0,1596378528,NULL,'MCEF/BCE - 305',NULL),(75,'core_course-course-23',23,'Computer Organization and Architecture','',308,'core_course-course',1,23,0,1596378528,NULL,'MCEF/BCE - 304',NULL),(76,'core_course-course-22',22,'Management -1 (Organizational Behaviour)','',307,'core_course-course',1,22,0,1596378528,NULL,'MCEF/BCE - 303',NULL),(77,'core_course-course-21',21,'Data Structure and Algorithms','',306,'core_course-course',1,21,0,1596378528,NULL,'MCEF/BCE - 302',NULL),(78,'core_course-course-20',20,'Object Oriented Programming Using C++','',305,'core_course-course',1,20,0,1596378528,NULL,'MCEF/BCE - 301',NULL),(79,'core_course-course-19',19,'Electrical and Electronics Enginering Lab','',304,'core_course-course',1,19,0,1596378528,NULL,'MCEF/BCE - 205L',NULL),(80,'core_course-course-17',17,'Applied Chemistry Lab','',302,'core_course-course',1,17,0,1596378528,NULL,'M