 a missionary, charitable and humanitarian institution, seeks to impart inclusive education to learners from all creeds, castes and religions. Sardar Parkash Singh Badal, the former Chief Minister had announced during fourth centenary celebrations of the installation of Sri Adi Granth at Golden Temple that a university dedicated to the ideals enshrined in Sri Guru Granth Sahib would be established. His dream reached fruition when the Punjab Legislative Assembly passed Sri Guru Granth Sahib World University Act (Punjab State Act 20/2008) and the SGGSWU commenced its first academic session in July 2011. The University has also secured the membership of AIU (Association of Indian Universities)- Membership No. 614. There has been no looking back since then. With all kinds of support from the State and the SGPC, the University has made rapid strides, in a short span of time, to emerge as a premier institution of higher learning in North India. Several innovative academic programmes in the fields of emerging technologies, sciences and humanities are being run by the University for the benefit of the students. Major thrust areas of the University are promotion of value based quality education and research. It is a matter of great pride for us that research projects worth more than Rs. 3 crores have been awarded to the University faculty by the national agencies such as the DST, CSIR and DAE etc. A large number of faculty members are actively involved in carrying out research and publish their papers regularly in journals of international and national repute. Workshops and competitions for the holistic growth of personality of the learners and for providing hands-on training in the use of scientific equipment are structured into the very curriculum, the University offers. In order to promote scholastic excellence and interdisciplinary approach, the academic structure of the University has been divided into Faculty System. The University learners are provided with the state-of -the-art technological infrastructure by way of very well equipped labs. In order to promote inclusive education and merit, several scholarships are provided by the University to the needy and meritorious students, students belonging to minority communities, SC, ST, and single girl child students. Apart from this, fee concessions and scholarships are provided to meritorious students. Modern life is characterized by alienations of myriad hues. The teachings of the Sikh Gurus, enshrined in Sri Guru Granth Sahib can go a long way in healing the rift which scars the psyche of the modern man by uniting him to his own self, the society around him and to the Divine Light whose residence is the human heart. The University has adopted five neighboring villages for their overall development. The University seeks to promote holistic growth of the learners\' personality. Hence, along with the pursuit of excellence in academics, there is great emphasis on sports, extra-curricular and extra-mural activities. This is owing to the University\'s impetus on the overall personality development of its students that the training and placement cell of the University has achieved success in providing attractive job offers with packages of up to Rs. 12 lakh per annum to the students. The University Training and Placement Cell, is whole heartedly committed to get each and every student placed in reputed companies. The University students, specifically from sciences and engineering courses are also making their mark in R&D sector at international platform. In a short span of time, the University has emerged as a podium for bright future of young India. SGGSWU - IDENTITY The University owes its identity to the rich legacy of the Shiromani Gurdwara Parbandhak Committee (SGPC). The SGPC, a parliamentary body of the Sikh community, besides managing the Holy Sikh Shrines, runs many prestigious educational institutions including two Universities, a Medical College, a Dental College, two Engineering Colleges, an Institute of Research and Development, an Education College, forty-three Degree Colleges, Fifty schools, Charitable Hospitals, and many Charitable trusts. The alumni of its educational institutes are making excellent marks not only as successful professionals in their respective fields, but also by proving themselves as responsible human beings while following the core human values and ethics enshrined in Sri Guru Granth Sahib ji. The SGPC had set up its first educational institute at Mumbai in 1937 and is since then serving the cause of education. The University is a step higher in this service to mankind. The University is the articulation of the aspirations of the Sikh community and aims to excel in facilitating the world class infrastructure and updated practical education to the young aspirants. The University, like its parent-body, is a charitable institute, committed to impart quality education to all sections of society irrespective of caste, creed and religion. ',2,'core_course-section',1,1,0,1596117467,NULL,NULL,NULL),(144,'core_course-section-13',13,'Np Completemness','P VS NP http://www.youtube.com/v/YX40hbAHx3s#P%20vs.%20NP%20and%20the%20Computational%20Complexity%20Zoo ',206,'core_course-section',1,3,0,1596162513,NULL,NULL,NULL),(145,'core_course-section-14',14,'Books','',206,'core_course-section',1,3,0,1596189979,NULL,NULL,NULL),(146,'core_course-section-315',315,'About Course','LEARNING OBJECTIVES: * Analyse the asymptotic performance of algorithms. * Write rigorous correctness proofs for algorithms. * Demonstrate a familiarity with major algorithms and data structures. * Apply important algorithmic design paradigms and methods of analysis. * Synthesize efficient algorithms in common engineering design situations. COURSE OUTCOMES: * Ability to analyse the performance of algorithms. * Ability to choose appropriate algorithm design techniques for solving problems. * Ability\' to understand how the choice of data structures and the algorithm design methods impact the performance of programs. * To understand the variations among tractable and intractable problems. To introduce P and NP classes.',206,'core_course-section',1,3,0,1596378949,NULL,NULL,NULL),(147,'core_course-section-19',19,'Book','',289,'core_course-section',1,4,0,1596379681,NULL,NULL,NULL),(148,'core_course-section-16',16,'About Course','',289,'core_course-section',1,4,0,1596381578,NULL,NULL,NULL),(149,'core_course-section-21',21,'About Course','',290,'core_course-section',1,5,0,1596381687,NULL,NULL,NULL);
